import React, {ButtonHTMLAttributes} from "react";
import {RouteComponentProps} from "react-router";
import {App, Server} from "../types/types";

interface Props {
    apps: App[];
    editApp: (app: App) => void;
    removeApp: (id: string) => void;
    startOrStopApp: (id: string) => void;
}

export const AppList: React.FC<Props> = props => {
    const {apps, removeApp, startOrStopApp} = props;

    const startOrDown = (e: React.SyntheticEvent<HTMLButtonElement>, id: string): void => {
        startOrStopApp(id);
    };
    const deleter = (e: React.SyntheticEvent<HTMLButtonElement>, id: string): void => {
        let decision = window.confirm('Точно удалить?');
        if (decision) {
            removeApp(id);
        }
    };
    const list = apps[0] !== undefined ? (apps.map((app: App, key: number) => {
            <tr key={key}>
                <td>{app.name}</td>
                <td>{app.ip}</td>
                <td>{app.port}</td>
                <td>{app.link}</td>
                <td>{app.appLang}</td>
                <td>{app.type}</td>
                <td>
                    <button className={`btn ${app.status === 'online' ? 'btn-delete_stop' : 'btn-start'}`} onClick={(e) => {
                        startOrDown(e, app.id)
                    }}>{app.status === 'online' ? 'Stop' : 'Start'}</button>
                </td>
                <td>
                    <button className="btn btn-delete_stop"  onClick={(e) => deleter(e, app.id)}>Delete app</button>
                </td>
            </tr>
        }))
        : null;

    return (
        <div>
            <table className={'appList'}>
                <thead>
                <tr>
                    <td>Name</td>
                    <td>Ip</td>
                    <td>Port</td>
                    <td>Repository link</td>
                    <td>Application language</td>
                    <td>Application type</td>
                    <td/>
                    <td/>
                </tr>
                </thead>
                <tbody>
                {list}
                </tbody>
            </table>
        </div>
    );
};
